# выбрать уравнение (коэффициенты) из их кортежей
def choice_equation(typ):
    return choice(dict_types[typ][0])


# Проверить, число целое => преобразовать в int
def check_int(x):
    if x == int(x):
        return int(x)
    return x


# Специально для text_to_print. Проверка, является ли однёркой
def is_one(a):
    if a == 1:
        a = ''
    elif a == -1:
        a = '-'
    return a


# Вернуть дробь в красивом виде (вместо двух точек палка)
def convert_ch_zn(ch, zn):
    ch, zn = map(str, (ch, zn))  # Нужно использовать класс Fraction, чтобы при проверке дробь могла сократиться. Ещё следует сделать проверку того, что передаётся в функцию - int, str всё это обрабатывать по-разному
    n = max(map(len, (ch, zn))) + 2
    return f'{ch.center(n)}\n{"\u2014"*n}\n{zn.center(n)}'


# Создать строковое представление уравнения
def mk_str_quadratic(equation):
    a, b, c = map(check_int, equation)
    a1 = is_one(a)
    equation_str = f'{a1}x\u00B2'
    if b != 0:
        if b == 1:
            equation_str += f' + x'
        elif b == -1:
            equation_str += f' - x'
        elif b < 0:
            equation_str += f' - {abs(b)}x'
        else:
            equation_str += f' + {b}x'
    if c != 0:
        if c < 0:
            equation_str += f' - {abs(c)} = 0'
        else:
            equation_str += f' + {c} = 0'
    else:
        equation_str += ' = 0'
    return equation_str


# Создать, расписать текст решения квадратного уравнения, решить его
def resh_quadratic(a=0, b=0, c=0):
    a, b, c = map(check_int, (a, b, c))
    if a != 0 and b != 0 and c != 0:
        if b > 0:
            d = f'{b}\u00B2'
        else:
            d = f'({b})\u00B2'
        if a * c > 0:
            d += ' - '
        else:
            d += ' + '
        d += f'4•{abs(a)}•{abs(c)} = {b ** 2 - 4 * a * c}'
        text_to_print = f'{mk_str_quadratic((a, b, c))}\n\na = {a}    b = {b}    c = {c}\n\nD = {d}'
        d = b ** 2 - 4 * a * c
        x1 = (-b + d ** 0.5) / 2 / a
        x2 = (-b - d ** 0.5) / 2 / a
        if isinstance(x1, float):
            x1 = check_int(x1)
        if isinstance(x2, float):
            x2 = check_int(x2)
        if b > 0:
            B = '-' + str(abs(b))
        else:
            B = abs(b)
        if a > 0:
            A = a
        else:
            A = f'({a})'
        if d < 0:
            text_to_print += '\n\nD < 0, значит, уравнение не имеет действительных корней'
        elif d > 0:
            text_to_print += f'\n\nX\u2081 = ({B} + \u221a{d}) : (2 • {A}) = {x1}\nX\u2082 = ({B} - \u221a{d}) : (2 ⋅ {A}) = {x2}'
        else:
            text_to_print += f'\n\nX = ({B} + \u221a{d}) : (2 • {A}) = {x1}'
        return text_to_print
    elif c == 0 and b == 0:
        text_to_print = f'{a}x\u00B2 = 0\n'
        text_to_print += f'x = 0'
        return text_to_print
    elif c == 0:
        a1 = is_one(a)
        text_to_print = f'{mk_str_quadratic((a, b, c))}\nx \u2022 ({a1}x'
        if b < 0:
            text_to_print += f' - {abs(b)}) = 0\n'
        else:
            text_to_print += f' + {b}) = 0\n'
        sp = resh_linear(a, b).splitlines()
        text_to_print += f'x = 0    или    {sp[0]}\n'
        for line in sp[1:]:
            text_to_print += f'                {line}\n'
        return text_to_print
    elif b == 0:
        a1 = is_one(a)
        text_to_print = f'{mk_str_quadratic((a, b, c))}\n{a1}x\u00B2 = {-c}\n'
        c = -c
        if a != 1:
            text_to_print += f'x\u00B2 = {c} :'
            if a < 0:
                text_to_print += f' ({a})\n'
            else:
                text_to_print += f' {a}\n'
            text_to_print += f'x\u00B2 = {check_int(c/a)}\n'
        if c/a > 0:
            text_to_print += f'x = \u00B1 {check_int((c/a)**0.5)}'
        else:
            text_to_print += 'Корней нет'
        return text_to_print


# Возвращает корень уравнения
def x_quadratic(a=0, b=0, c=0):
    if a == 0:
        return 'a != 0'
    d = b ** 2 - 4 * a * c
    x1 = check_int((-b + d ** 0.5) / 2 / a)
    x2 = check_int((-b - d ** 0.5) / 2 / a)
    return sorted([x1, x2])


# Создать строковое представление уравнения
def mk_str_linear(equation):
    k, b = map(check_int, equation)
    equation_str = str(is_one(k))
    equation_str += 'x'
    if b != 0:
        if b < 0:
            equation_str += f' - {abs(b)} = 0'
        else:
            equation_str += f' + {b} = 0'
    else:
        equation_str += f' = 0'
    return equation_str


# Создать, расписать текст решения линейного уравнения, решить его
def resh_linear(k=0, b=0):
    k, b = map(check_int, (k, b))
    text_to_print = f'{mk_str_linear((k, b))}\n'
    if b != 0:
        text_to_print += f'{str(is_one(k))}x ='
        if b > 0:
            text_to_print += f' {-b}\n\n'
        else:
            text_to_print += f' {abs(b)}\n\n'
        b = -b
        if k == 1:
            return text_to_print
        text_to_print += 'x ='
        text_to_print += f' {b} :'
        if k < 0:
            text_to_print += f' ({k})'
        else:
            text_to_print += f' {k}'
        text_to_print += f'\n\nx = {check_int(b/k)}'
    else:
        text_to_print += 'x = 0'
    return text_to_print


# Возвращает корень уравнения
def x_linear(k=0, b=0):
    if k == 0:
        return 'k != 0'
    return check_int(-b / k)


# Создать строковое представление уравнения
def mk_str_propor(equation):
    a, b, c = map(check_int, equation)
    equation_str = ''
    equation_str += f'{c} :'
    if a < 0:
        equation_str += f' (x - {abs(a)})'
    else:
        equation_str += f' (x + {a})'
    if b < 0:
        equation_str += f' - {abs(b)}'
    else:
        equation_str += f' + {b}'
    equation_str += ' = 0'
    return equation_str


# Создать, расписать текст решения уравнения обратной пропорциональности, решить его
def resh_propor(a=0, b=0, c=0):
    a, b, c = map(check_int, (a, b, c))
    if a != 0:
        now_equation = mk_str_propor((a, b, c))
        text_to_print = now_equation + '\n'
        text_to_print += f'{c} :'
        if a < 0:
            text_to_print += f' (x - {abs(a)})'
        else:
            text_to_print += f' (x + {a})'
        b = -b
        text_to_print += f' = {b}\n'
        text_to_print += f'{c} ='
        text_to_print += f' {b} \u2022'
        if a < 0:
            text_to_print += f' (x - {abs(a)})\n'
        else:
            text_to_print += f' (x + {a})\n'
        if b == 1:
            text_to_print += f'{c} = x'
            if a < 0:
                text_to_print += f' - {abs(a)}\n'
            else:
                text_to_print += f' + {a}\n'
        else:
            text_to_print += f'{c} :'
            if b < 0:
                text_to_print += f' ({b}) = x'
            else:
                text_to_print += f' {b} = x'
            if a < 0:
                text_to_print += f' - {abs(a)}\n'
            else:
                text_to_print += f' + {a}\n'
        cb = check_int(c/b)
        text_to_print += f'{cb}'
        a = -a
        if a < 0:
            text_to_print += f' - {abs(a)} = x\n'
        else:
            text_to_print += f' + {a} = x\n'
        text_to_print += f'x = {cb+a}'
    else:
        text_to_print = f'{c} : x'
        if b < 0:
            text_to_print += f' - {abs(b)} = 0\n'
        else:
            text_to_print += f' + {b} = 0\n'
        b = -b
        text_to_print += f'{c} : x = {b}\n'
        text_to_print += f'{c} = {b} \u2022 x\n'
        if b != 1:
            text_to_print += f'{c} :'
            if b < 0:
                text_to_print += f' ({b}) = x\n'
            else:
                text_to_print += f' {b} = x\n'
        text_to_print += f'x = {check_int(c/b)}'
    return text_to_print


# Возвращает корень уравнения
def x_propor(a=0, b=0, c=0):
    if b == 0 or c == 0:
        return 'c != 0, b != 0'
    return check_int(c/(-b) - a)


# Создание графика. Принимает коэффициенты и тип уравнения
def create_graphic(equation, typ):
    fig, plot = plt.subplots()
    plot.spines['top'].set_linewidth(0)
    plot.spines['right'].set_linewidth(0)
    plot.spines['bottom'].set_linewidth(0)
    plot.spines['left'].set_linewidth(0)
    plt.grid()
    if typ == 'quadratic':
        a, b, c = map(check_int, equation)
        d = b ** 2 - 4 * a * c
        if d > 0:
            x1, x2 = x_quadratic(a, b, c)
        x0 = -b/2/a
        if d > 0:
            x_min, x_max = x1 - 3, x2 + 3
            y_min = a*x0**2 + b*x0 + c - 1
        else:
            x_min, x_max = x0 - 5, x0 + 5
            y_min = -3
        y_max = a*x_min**2 + b*x_min + c
        if a < 0:
            y_min = abs(y_min + 2)
        x = np.linspace(x_min, x_max, 1000)
        y = a*x**2 + b*x + c
        if d > 0:
            plt.scatter(x1, 0, color='DarkRed', s=50)
            plt.scatter(x2, 0, color='DarkRed', s=50)
        plt.scatter(x0, -d/4/a, color='DarkRed', s=50)
        plt.plot([x0, x0], [y_min, y_max], ls='--', color='Orange', lw=1)
        fig.canvas.manager.set_window_title('y = ' + mk_str_quadratic(equation).split(' = ')[0])
    elif typ == 'linear':
        k, b = map(check_int, equation)
        Ox = x_linear(k, b)
        x_min, x_max = sorted([0, Ox])
        delta = (x_max-x_min)/2
        if b != 0:
            x_min -= delta
            x_max += delta
        else:
            x_min -= 3
            x_max += 3
        x = [x_min, x_max]
        y_min, y_max = k*x_min + b, k*x_max + b
        y = [y_min, y_max]
        plt.scatter(Ox, 0, color='DarkRed', s=50)
        plt.scatter(0, b, color='DarkRed', s=50)
        fig.canvas.manager.set_window_title('y = ' + mk_str_linear(equation).split(' = ')[0])
    elif typ == 'propor':
        a, b, c = map(check_int, equation)
        x_min, x_max, dx = -20 - a, 20 - a, 0.1
        if x_max < 0:
            x_max = 2
        if x_min > 0:
            x_min = -2
        if x_min > x_propor(a, b, c):
            x_min = x_propor(a, b, c) - 2
        elif x_max < x_propor(a, b, c):
            x_max = x_propor(a, b, c) + 2
        x = np.around(np.arange(x_min, x_max, dx), decimals=4)
        y = c / (x + a) + b
        y[np.isinf(y)] = np.nan
        while np.nanmin(y) > 0:
            dx = dx/1.5
            x = np.around(np.arange(x_min, x_max, dx), decimals=4)
            y = c / (x + a) + b
            y[np.isinf(y)] = np.nan
        while np.nanmax(y) < 0:
            dx = dx/1.5
            x = np.around(np.arange(x_min, x_max, dx), decimals=4)
            y = c / (x + a) + b
            y[np.isinf(y)] = np.nan
        y_min, y_max = np.nanmin(y), np.nanmax(y)
        if c != 0 and b != 0:
            x0 = x_propor(a, b, c)
            plt.scatter(x0, 0, color='DarkRed', s=50)
        fig.canvas.manager.set_window_title('y = ' + mk_str_propor(equation).split(' = ')[0])
        plt.plot([x_min, x_max], [b, b], ls='--', lw=1, color='Orange')
        plt.plot([-a, -a], [y_min, y_max], ls='--', lw=1, color='Orange')
    plt.plot([x_min, x_max], [0, 0], color='DarkOrange', alpha=0.8, lw=1.8)
    plt.scatter(max(x_max, x_min), 0, marker='>', color='DarkOrange')
    plt.annotate('x', xy=(x_max, 0))
    plt.plot([0, 0], [y_min, y_max], color='DarkOrange', alpha=0.8, lw=1.8)
    plt.scatter(0, max(y_max, y_min), marker='^', color='DarkOrange')
    plt.annotate('y', xy=(0, max(y_max, y_min)))
    plt.plot(x, y, lw=2, color='Blue')
    plt.show()


# Создать документ, изменить настройки
def create_docx(name, text):
    doc = Document()
    sections = doc.sections
    for section in sections:
        section.top_margin = Inches(0.4)
        section.bottom_margin = Inches(0.4)
        section.left_margin = Inches(0.4)
        section.right_margin = Inches(0.4)
    style = doc.styles['Normal']
    font = style.font
    font.name = 'MingLiU-ExtB'
    font.size = Pt(12)
    font.bold = True
    doc.add_paragraph(text)
    doc.save(name)


# Создать файл с уравнениями + файл с ответами на них
def create_test(var_count=0, lin=0, prop=0, quad=0, path=''):
    # Создаём текст для документов
    var_count = var_count // 3 + (var_count % 3 != 0)
    v = [[[], [], []] for _ in range(var_count)]
    for i in range(var_count):
        for j in range(3):
            sp = [[], []]
            for n in range(lin):
                equation = choice_equation('linear')
                sp[0].append(mk_str_linear(equation))
                sp[1].append('x = ' + str(x_linear(*equation)))
            for n in range(prop):
                equation = choice_equation('propor')
                sp[0].append(mk_str_propor(equation))
                sp[1].append('x = ' + str(x_propor(*equation)))
            for n in range(quad):
                equation = choice_equation('quadratic')
                sp[0].append(mk_str_quadratic(equation))
                sp[1].append('x = ' + ', x = '.join(map(str, x_quadratic(*equation))))
            v[i][j] = sp
    st_eq, st_ans = '', ''
    var_n = 1
    for i in range(var_count):
        head = f'{("Вариант " + str(var_n)).center(30)}{("Вариант " + str(var_n + 1)).center(30)}{("Вариант " + str(var_n + 2)).center(30)}\n'
        st_eq += head
        st_ans += head
        for eq in range(sum([lin, prop, quad])):
            for j in range(3):
                st_eq += f'{v[i][j][0][eq].ljust(30)}'
                st_ans += f'{v[i][j][1][eq].ljust(30)}'
            st_eq += '\n'
            st_ans += '\n'
        st_eq += '\n'
        st_ans += '\n'
        var_n += 3
    # Создаём сами документы
    create_docx(path+'/Задание уравнения.docx', st_eq)
    create_docx(path+'/Ответы уравнения.docx', st_ans)


