def training(event):
    clear_canvas()
    quad_incl, prop_incl, lin_incl = '0', '0', '0'

    def change_check_b(event):
        butt = canvas.find_withtag("current")[0]
        x, y = map(int, canvas.coords(butt))
        tag = canvas.gettags(butt)
        canvas.delete(butt)
        if tag[1] == '0':
            butt = canvas.create_image(x, y, anchor=tk.NW, image=check_b_on_im)
            canvas.itemconfig(butt, tags=(tag[0], '1'))
        else:
            butt = canvas.create_image(x, y, anchor=tk.NW, image=check_b_off_im)
            canvas.itemconfig(butt, tags=(tag[0], '0'))
        canvas.tag_bind(butt, '<Button-1>', change_check_b)

    def choose_train():
        global check_b_off_im, check_b_on_im, start_train_im, choose_text_typ_im, start_train_pressed_im
        start_train_im = PhotoImage(file=paths('images/start_train.png'))
        start_train_pressed_im = PhotoImage(file=paths('images/start_train_pressed.png'))
        check_b_off_im = PhotoImage(file=paths('images/check_b_off.png'))
        check_b_on_im = PhotoImage(file=paths('images/check_b_on.png'))
        choose_text_typ_im = PhotoImage(file=paths('images/choose_text_typs.png'))
        canvas.create_image(78, 67, anchor=tk.NW, image=choose_text_typ_im)
        ch_quad = canvas.create_image(56, 183, anchor=tk.NW, image=check_b_off_im, tags=('ch_quad', '0'))
        ch_prop = canvas.create_image(56, 284, anchor=tk.NW, image=check_b_off_im, tags=('ch_prop', '0'))
        ch_lin = canvas.create_image(56, 376, anchor=tk.NW, image=check_b_off_im, tags=('ch_lin', '0'))
        canvas.tag_bind(ch_quad, '<Button-1>', change_check_b)
        canvas.tag_bind(ch_prop, '<Button-1>', change_check_b)
        canvas.tag_bind(ch_lin, '<Button-1>', change_check_b)
        start_train_b = canvas.create_image(593, 426, anchor=tk.NW, image=start_train_im)
        canvas.tag_bind(start_train_b, "<Enter>", lambda event: on_enter(start_train_b, image=start_train_pressed_im))
        canvas.tag_bind(start_train_b, "<Leave>", lambda event: on_leave(start_train_b, image=start_train_im))
        canvas.tag_bind(start_train_b, '<Button-1>', start_train)

    def start_train(event):
        global quad_incl, prop_incl, lin_incl, sp_err, vsego, start_time
        quad_incl, prop_incl, lin_incl = canvas.gettags(canvas.find_withtag('ch_quad')[0])[1], canvas.gettags(canvas.find_withtag('ch_prop')[0])[1], canvas.gettags(canvas.find_withtag('ch_lin')[0])[1]
        sp_err, vsego, start_time = [], 0, datetime.now()
        clear_canvas()
        choice_eq()

    def choice_eq():
        global quad_incl, prop_incl, lin_incl, x1x2_im, x1_answ, x2_answ, x_im, x_answ, zav_im, zav_pressed_im, typ, eq, active_el
        sp_choice = []
        if int(quad_incl):
            sp_choice.append('quadratic')
        if int(prop_incl):
            sp_choice.append('propor')
        if int(lin_incl):
            sp_choice.append('linear')
        if sp_choice:
            typ = choice(sp_choice)
            eq = choice(dict_types[typ][0])
            if typ == 'quadratic':
                str_eq = mk_str_quadratic(eq)
                x1x2_im = PhotoImage(file=paths('images/x1x2.png'))
                canvas.create_image(280, 225, anchor=tk.NW, image=x1x2_im)
                x1_answ = tk.Entry(root, border=0, width=3, font=gloria, bg='#BBDEF2', validate="key", validatecommand=(root.register(lambda char: char.isdigit() or char == "" or char == '-' or char == ','), '%S'))
                x1_answ.place(x=440, y=280, height=75)
                x1_answ.focus()
                x2_answ = tk.Entry(root, border=0, width=3, font=gloria, bg='#BBDEF2', validate="key", validatecommand=(root.register(lambda char: char.isdigit() or char == "" or char == '-' or char == ','), '%S'))
                x2_answ.place(x=440, y=385, height=75)
                x1_answ.bind('<Return>', lambda event: x2_answ.focus())
                x2_answ.bind('<Return>', check_x)
                active_el.extend([x1_answ, x2_answ])
            else:
                if typ == 'propor':
                    str_eq = mk_str_propor(eq)
                else:
                    str_eq = mk_str_linear(eq)
                x_im = PhotoImage(file=paths('images/x1.png'))
                canvas.create_image(280, 330, anchor=tk.NW, image=x_im)
                x_answ = tk.Entry(root, border=0, width=3, font=gloria, bg='#BBDEF2', validate="key", validatecommand=(root.register(lambda char: char.isdigit() or char == "" or char == '-' or char == ','), '%S'))
                x_answ.place(x=420, y=312, height=75)
                x_answ.focus()
                x_answ.bind('<Return>', check_x)
                active_el.append(x_answ)
            canvas.create_text(480, 140, anchor=tk.CENTER, text=str_eq, font=gloria)
            zav_im = PhotoImage(file=paths('images/zaversh.png'))
            zav_pressed_im = PhotoImage(file=paths('images/zaversh_pressed.png'))
            zav = canvas.create_image(695, 481, anchor=tk.NW, image=zav_im)
            canvas.tag_bind(zav, "<Enter>", lambda event: on_enter(zav, image=zav_pressed_im))
            canvas.tag_bind(zav, "<Leave>", lambda event: on_leave(zav, image=zav_im))
            canvas.tag_bind(zav, '<Button-1>', zaversh)
        else:
            choose_train()

    def check_x(event):
        global vsego
        try:
            if typ == 'quadratic':
                x1 = float(x1_answ.get().replace(',', '.'))
                x2 = float(x2_answ.get().replace(',', '.'))
                if x_quadratic(*eq) == sorted([x1, x2]):
                    good_answ()
                else:
                    bad_answ()
            else:
                x = float(x_answ.get().replace(',', '.'))
                good_x = dict_types[typ][2](*eq)
                if good_x == x:
                    good_answ()
                else:
                    bad_answ()
            vsego += 1
        except ValueError:
            pass

    def good_answ():
        del_active_el()
        clear_canvas()
        choice_eq()

    def bad_answ():
        del_active_el()
        clear_canvas()
        sp_err.append(dict_types[typ][1](eq))
        choice_eq()

    def zaversh(event):
        global start_time, vsego, sp_err
        del_active_el()
        clear_canvas()
        if vsego == 0:
            main_menu('')
        else:
            canvas.create_text(97, 17, anchor=tk.NW, text=f'Решено: {vsego}\t\t\t\tВремя: {":".join(str(timedelta(seconds=(datetime.now()-start_time).seconds)).split(":")[1:])}', font=monts)
            canvas.create_text(97, 47, anchor=tk.NW, text=f'Ошибок: {len(sp_err)}', font=monts)
            canvas.create_text(97, 75, anchor=tk.NW, text=f'Верных: {int((vsego-len(sp_err))/vsego*100)}%', font=monts)
            if len(sp_err):
                canvas.create_text(97, 104, anchor=tk.NW, text='Ошибки допущены в этих примерах:', font=monts)
                if len(sp_err) > 7:
                    canvas.create_text(97, 150, anchor=tk.NW, text='\n'.join(sp_err[:7]), font=(gloria['family'], 20))
                    canvas.create_text(500, 150, anchor=tk.NW, text='\n'.join(sp_err[7:14]), font=(gloria['family'], 20))
                else:
                    canvas.create_text(300, 150, anchor=tk.NW, text='\n'.join(sp_err), font=(gloria['family'], 20))
            create_menu_b()

    choose_train()


