        canvas.tag_bind(m1, '<Button-1>', lambda event: decrement(count_var))
        canvas.tag_bind(p2, '<Button-1>', lambda event: increment(quad_count))
        canvas.tag_bind(m2, '<Button-1>', lambda event: decrement(quad_count))
        canvas.tag_bind(p3, '<Button-1>', lambda event: increment(prop_count))
        canvas.tag_bind(m3, '<Button-1>', lambda event: decrement(prop_count))
        canvas.tag_bind(p4, '<Button-1>', lambda event: increment(lin_count))
        canvas.tag_bind(m4, '<Button-1>', lambda event: decrement(lin_count))
        # Каждому +- добавляем эффект прожимания, при наведении
        def make(p, m):
            canvas.tag_bind(p, "<Enter>", lambda event: on_enter(p, image=plus_pressed_im))
            canvas.tag_bind(p, "<Leave>", lambda event: on_leave(p, image=plus_im))
            canvas.tag_bind(m, "<Enter>", lambda event: on_enter(m, image=minus_pressed_im))
            canvas.tag_bind(m, "<Leave>", lambda event: on_leave(m, image=minus_im))
        for p, m in ((p1, m1), (p2, m2), (p3, m3), (p4, m4)):
            make(p, m)
        path_b = canvas.create_image(607, 151, anchor=tk.NW, image=path_b_im)
